import React from "react";


const Genres = props => {
    let items = props.top_artist_items;
    let genre_list = [];

    for (let i = 0; i < 5; i++) {
        artist_genres = items[i].genres;
        for (let j = 0; j < artist_genres.length; j++) {
            genre_list.push(artist_genres[j])
        }
    }
    console.log(genre_list);

    return (
        <div className="App">
            <div className="genres-wrapper">
                {genre_list}
                <ol>
                    {genre_list.map((current_genre) => (
                        <li>{current_genre}</li>
                    ))}
                </ol>
                {items[1].genres}
                <ol>
                    {items[1].genres.map((current_genre) => (
                        <li>{current_genre}</li>
                    ))}
                </ol>
            </div>
            <div>
                <p>
                    hello
                </p>
            </div>
        </div>
    );
}

export default Genres;
